    false,nt"url": null,nt"notes": "This narrative report for Des Lacs Migratory
    Waterfowl Refuge outlines Refuge accomplishments from August through October of
    1939. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments. A progress report on field investigations
    and applied research is also provided. Photographs are attached.",nt"license_title":
